let editorChangeHandler = null;

/**
 * @return {EditorType}
 */
function getEditor() {
    return editor;
}

/**
 * @param {EditorType} newEditor
 */
function setEditor(newEditor) {
    editor = newEditor;
}

function addEditorChangeHandler(handler) {
    editorChangeHandler = handler;
}

/**
 * @param {Function} modifyFn
 * @param {Object} payload
 */
function dispatch(modifyFn, payload) {
    const editor = getEditor();
    let newEditor = modifyFn(editor, payload);

    setEditor(newEditor);

    if (editor.Presentation !== newEditor.Presentation && editor.editLog === newEditor.editLog) {
        dispatch(addToUndo, {EditorBeforeOperation: editor});
    }
    // console.log(newEditor);

    if (editorChangeHandler) {
        editorChangeHandler()
    }
}

export {
    getEditor,
    setEditor,
    dispatch,
    addEditorChangeHandler,
}